import React, { Component, Fragment } from "react";
import {
  AppBar,
  Button,
  TextField,
  Toolbar,
  Typography,
  Select,
  MenuItem,
  InputLabel,
  FormControl

} from "@material-ui/core";

export class FormUserDetails extends Component {
  continue = e => {
    e.preventDefault();
    this.props.nextStep();
  };

  constructor() {
    super();
    this.state = {};
  }

  render() {
      
    const { values, handleChange } = this.props;
    return (
      <section className="formg"  >
        <h3 className="textokoiform">Datos</h3>
        <div style={{flex:"row"}}>
        <TextField
          label="Primer Nombre"
          onChange={handleChange("firstName")}
          defaultValue={values.firstName}
          variant="outlined" 
          helperText="Some important text"
          margin="normal"
          InputLabelProps={{
            shrink: true,
          }}
          style={{ marginLeft: 5,marginBottom:0,  width: "45%"}}
        />
        <TextField
          label="apellido"
          onChange={handleChange("lastName")}
          defaultValue={values.lastName}
          variant="outlined" 
          helperText="Some important text"
          margin="normal"
          InputLabelProps={{
            shrink: true,
          }}
          style={{ marginLeft: 5,marginBottom:0,  width: "45%"}}
        />
        </div>
       
            <div className="select">
            <select name="slct" id="slct">
              <option selected disabled>Tipo de Boleto</option>
              <option value="1">Niño</option>
              <option value="2">Adulto</option>
            </select>
        
            </div>
        
       

    <div style={{flex:"row"}}>
        <TextField
          label="Correo"
          onChange={handleChange("email")}
          defaultValue={values.email}
          variant="outlined" 
          helperText="Some important text"
          margin="normal"
          InputLabelProps={{
            shrink: true,
          }}
          style={{ marginLeft: 5,marginBottom:0,  width: "45%"}}
        />
         <TextField
          label="Cedula"
          onChange={handleChange("cedula")}
          defaultValue={values.email}
          variant="outlined" 
          helperText="Some important text"
          margin="normal"
          InputLabelProps={{
            shrink: true,
          }}
          style={{ marginLeft: 5,marginBottom:0,  width: "45%"}}
        />
        </div>

        <div style={{flex:"row"}}>


        <div className="select">
        <select name="slct3" id="slct3">
          <option selected disabled>Tipo de Boleto</option>
          <option value="1">Niño</option>
          <option value="2">Adulto</option>
        </select>
     
        </div>
        </div>
        <div className="select">
        <select name="slct2" id="slct2">
          <option selected disabled>Tipo de Boleto</option>
          <option value="1">Niño</option>
          <option value="2">Adulto</option>
        </select>
     
        </div>
        <br />
        <br />
        <Button
          style={{ background: "#fa7b25", color: "#ffff",width: "90%",margin:"auto",height:"10%"}}
          label="Siguiente"
          onClick={this.continue}
        >
          Siguiente
        </Button>
      </section>
    );
  }
}

export default FormUserDetails;
